import React, { useState } from "react";
import {
  AppBar,
  Typography,
  Card,
  Paper,
  CardContent,
  TextField,
  Button,
  CardHeader,
} from "@material-ui/core";
import data from "../MOCK_DATA";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    maxWidth: "500px",
    marginTop: "100px",
    background:
      "radial-gradient(circle, rgba(6,103,144,1) 21%, rgba(174,45,181,1) 98%)",
    marginLeft: "auto",
    marginRight: "auto",
    opacity: "80%",
  },
  appBar: {
    background:
      "linear-gradient(90deg, rgba(2,0,36,1) 2%, rgba(2,0,36,1) 18%, rgba(6,103,144,1) 57%)",
  },
  paper: {
    elevation: "24",
  },
}));
function Login() {
  const classes = useStyles();
  return (
    <Paper elevation={24}>
      <Card className={classes.root}>
        <CardHeader></CardHeader>
        <CardContent>
          <form>
            <TextField
              id="filled-textarea"
              label=""
              placeholder="Enter your text here"
              multiline
              fullWidth={true}
              variant="filled"
            />
            <Button type="submit" variant="contained" color="primary">
              Post
            </Button>
          </form>
        </CardContent>
      </Card>
    </Paper>
  );
}

export default Login;
